import { useEffect, useState, useContext } from "react";
import Sidebar from "../Components/Sidebar";
import Navbar from "../Components/Navbar";
import api from "../api"; // your axios instance with baseURL
import { AuthContext } from "../Context/AuthContext";

const UserDashboard = () => {
  const { user } = useContext(AuthContext);
  const [stats, setStats] = useState({
    customers: 0,
    invoices: 0,
    leads: 0,
    inProgressLeads: 0,
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const token = localStorage.getItem("token");

        // Fetch all data concurrently
        const [custRes, invRes, leadRes] = await Promise.all([
          api.get("/customers", { headers: { Authorization: `Bearer ${token}` } }),
          api.get("/invoices", { headers: { Authorization: `Bearer ${token}` } }),
          api.get("/leads", { headers: { Authorization: `Bearer ${token}` } }),
        ]);

        const customers = custRes.data.items || custRes.data || [];
        const invoices = invRes.data.items || invRes.data || [];
        const leads = leadRes.data.items || leadRes.data || [];

        const inProgress = leads.filter(
          (l) => l.status === "Contacted" || l.status === "Qualified"
        ).length;

        setStats({
          customers: customers.length,
          invoices: invoices.length,
          leads: leads.length,
          inProgressLeads: inProgress,
        });
      } catch (err) {
        console.error("Error fetching dashboard stats:", err.response?.data || err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchStats();
  }, []);

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <Sidebar />

      {/* Main Content */}
      <div className="flex-1 flex flex-col bg-bg">
  <Navbar />
  <main className="p-6">
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
      <div className="bg-card p-6 rounded-lg shadow hover:shadow-lg transition border-t-4 border-primary">
        <h2 className="text-lg font-semibold text-text">Customers</h2>
        <p className="text-3xl font-bold mt-2 text-primary">{stats.customers}</p>
      </div>

      <div className="bg-card p-6 rounded-lg shadow hover:shadow-lg transition border-t-4 border-secondary">
        <h2 className="text-lg font-semibold text-text">Invoices</h2>
        <p className="text-3xl font-bold mt-2 text-secondary">{stats.invoices}</p>
      </div>

      <div className="bg-card p-6 rounded-lg shadow hover:shadow-lg transition border-t-4 border-accent">
        <h2 className="text-lg font-semibold text-text">Leads</h2>
        <p className="text-3xl font-bold mt-2 text-accent">{stats.leads}</p>
      </div>

      <div className="bg-card p-6 rounded-lg shadow hover:shadow-lg transition border-t-4 border-yellow-500">
        <h2 className="text-lg font-semibold text-text">Leads In Progress</h2>
        <p className="text-3xl font-bold mt-2 text-yellow-500">{stats.inProgressLeads}</p>
      </div>
    </div>

    <div className="mt-8 grid grid-cols-1 md:grid-cols-3 gap-4">
      <button className="bg-primary text-white p-4 rounded shadow hover:bg-primary/90 transition">
        Add Customer
      </button>
      <button className="bg-secondary text-white p-4 rounded shadow hover:bg-secondary/90 transition">
        Add Invoice
      </button>
      <button className="bg-accent text-white p-4 rounded shadow hover:bg-accent/90 transition">
        Add Lead
      </button>
    </div>
  </main>
</div>

    </div>
  );
};

export default UserDashboard;
